import React,{Component} from 'react';
import BottomNavLeft from 'BottomNavLeft';
import BottomNavRight from 'BottomNavRight'


class BottomNav extends Component{
    render() {
        return (
            <div class="row bottom-nav">
                <BottomNavLeft />
                <BottomNavRight />
            </div>
        )
    };
}

export default BottomNav;
